INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/03/22 14:59:59", 0.0, 3, 1, "アネモネ", 0.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", -470.0, 1, 2, 129602, "2023/12/15 15:00:00", 10009);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/03/22 14:59:59", 0.0, 3, 1, "アネモネ", 0.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", -470.0, 2, 2, 129602, "2023/12/15 15:00:00", 10010);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/03/22 14:59:59", 0.0, 3, 1, "ネフィ=ネラ", 0.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", -470.0, 1, 1, 129701, "2023/12/15 15:00:00", 10011);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/03/22 14:59:59", 0.0, 3, 1, "ネフィ=ネラ", 6.2, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", -470.0, 2, 2, 129701, "2023/12/15 15:00:00", 10012);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/06/22 14:59:59", 0.0, 4, 5, "カノン", 3.1, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", -470.0, 1, 3, 130301, "2024/03/15 15:00:00", 10013);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/06/22 14:59:59", 0.0, 4, 2, "カノン", 6.15, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", -470.0, 2, 3, 130301, "2024/03/15 15:00:00", 10014);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/06/22 14:59:59", 0.0, 4, 2, "ナーナ", 0.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", -470.0, 1, 2, 130401, "2024/03/15 15:00:00", 10015);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/06/22 14:59:59", 0.0, 4, 1, "ナーナ", 3.35, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", -470.0, 2, 2, 130401, "2024/03/15 15:00:00", 10016);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/09/22 14:59:59", 0.0, 5, 1, "ホウオウ", 0.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", -470.0, 1, 1, 130502, "2024/06/15 15:00:00", 10017);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/09/22 14:59:59", 0.0, 5, 1, "ホウオウ", 3.18, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", -470.0, 2, 2, 130502, "2024/06/15 15:00:00", 10018);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/09/22 14:59:59", 0.0, 5, 4, "ホウオウ", 0.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", -470.0, 3, 4, 130503, "2024/06/15 15:00:00", 10019);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/09/22 14:59:59", 0.0, 5, 2, "ネア", 4.9, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", -470.0, 1, 1, 123301, "2024/06/15 15:00:00", 10020);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/09/22 14:59:59", 0.0, 5, 2, "ネア", 4.8, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, 2, 1, 123301, "2024/06/15 15:00:00", 10021);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/12/22 14:59:59", 0.0, 6, 1, "カリザ", 4.922, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", -470.0, 1, 3, 133301, "2024/09/15 15:00:00", 10022);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/12/22 14:59:59", 0.0, 6, 5, "カリザ", 9.638, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", -470.0, 2, 3, 133301, "2024/09/15 15:00:00", 10023);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/12/22 14:59:59", 0.0, 6, 2, "ミーア", 2.88, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", -470.0, 1, 1, 133401, "2024/09/15 15:00:00", 10024);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2024/12/22 14:59:59", 0.0, 6, 1, "ミーア", 4.818, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", -470.0, 2, 5, 133401, "2024/09/15 15:00:00", 10025);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, "2025/03/22 14:59:59", 0.0, 7, 1, "グレイス", 1.78, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", -470.0, 1, 2, 133002, "2024/12/15 15:00:00", 10026);
